INSERT INTO `notice` VALUES (1,2,'s','2022-04-20 12:25:00','2022-06-01 10:07:39','在线评测系统介绍','面向高校的在线评测系统的设计与实现','<p>（1）背景意义<br>随着我国信息技术的发展，编程技术在青少年人群中越来越普及，许多高校、科研机构为提高用户算法水平都纷纷推出在线评测系统。在线评测系统因其便捷性、通用性和实时性受到广大用户的欢迎。<br>在线评测系统起源于ACM-ICPC国际大学生程序设计竞赛，随后OI信息学奥林匹克竞赛中也开始使用，主要负责自动判题和排名等功能。现在世界各地的高校大学生都在使用在线评测系统进行各种程序设计的训练、比赛队员的集训等，现如今，在各类程序设计竞赛中，也在采用在线评测系统进行自动判题和比赛排名。<br>国外著名的在线评测系统有俄罗斯的SGU（萨拉托夫大学）、URAL（乌拉尔大学）、MIPT（EL Judge），西班牙的UVA（瓦拉杜利德大学），美国的USACO以及波兰的SPOJ。国内的在线评测系统都有：HDUOJ (杭州电子科技大学)、ZOJ（浙江大学）、POJ（北京大学）、HUSTOJ（华中科技大学）、HITOJ（哈尔滨工业大学）等<br>国内外对于在线评测系统的开发都非常完善，每个系统都有自己的特色，都能给编程人员提供一个很好的练习平台，但是这些在线评测系统对后台维护的重视程度不够，导致现有的在线评测系统没有一个好的运维环境，主要表现在界面不友好，管理功能不够完全，对于很多操作没有提供服务，都需要更改数据库完成相关功能，管理难度大。<br>因此设计并实现一个在线评测系统，对于管理者，一个功能完善的系统可以充分降低运维成本。不仅可以对用户代码和提交文档进行查重，而且针对用户数据给出个性化题目推荐，对用户提高算法水平提供了有力支撑，具有很好的现实意义和社会意义。<br>（2）培养目标<br>本课题将有助于学生进行在线评测系统的开发、沙盒平台以及推荐系统的搭建。使学生深入理解在线评测系统中系统安全性的重要性、深入理解程序编译与运行在实践中的运用。培养学生使用查重算法来解决现实科研与教学活动中存在的学术问题的意识，提供解决该问题的策略，以及如何高效的解决该类问题。本课题的实现阶段，培养学生查找解决方案的能力和编程能力，对比实验将培养学生的数据分析能力，发现规律能力。</p>'),(2,1,'u','2022-04-26 11:09:20','2022-05-30 20:08:42','基本功能','基本功能列表','<p>1.通过前后端分离、模块化编程、微服务等方法实现整个项目的开发。<br>2.基于沙盒编译运行程序，保证程序安全性，并尽可能降低系统所占用的负载，提高判题服务器运行效率。<br>3.项目设计外观简约、大气，有丰富的可视化图表显示各项信息；各功能符合用户使用习惯；开发出支持不同客户平台运行的Web网站和APP。<br>4.支持多种编程语言，如C、C++、C#、Java、Python2、Python3等。<br>5.对指定的一定范围内的代码进行查重，并生成查重报告。<br>6.对指定的一定范围内的报告文档（word和PDF格式）进行查重。<br>7.拥有多种不同竞赛模式，如ACM、OI、IOI等，比赛创建者可自定义竞赛积分规则细节；可进行实时性或非实时性评判。<br>8.实现批量导入题目的接口，支持对其他不同OJ平台题库与样例文件的导入；并能导出兼容其它OJ平台的题库与样例文件。<br>9.用户个人信息管理；实现细致的用户权限划分，不同权限的人员拥有不同级别的功能权限。&nbsp;<br>10.实现题目创建和导入的丰富性；编辑题目提供markdown语法支持，可导入xml、图片、word、PDF等不同格式的文档。<br>11.基本的推荐功能，根据用户测试问题数量、正确率、各个算法类型题目错误率等指标推荐符合用户当前算法水平的题目以提高用户编程与算法能力。<br>12.个性化推荐功能，根据用户提供的偏好算法题目类型等信息推荐给用户相应题目。</p>'),(3,2,'h','2022-04-28 16:15:03','2022-05-27 11:26:06','添加测试','描述','<p>在思想上，我做到了积极上进，热爱祖国、热爱人民，拥护中国共产党的领导、拥护党的各项方针政策，遵守国家的法律法规及各项规章制度。积极向党组织靠拢，于上学期向党递交入党申请书，并成为预备党员。有很强的上进心，勇于批评与自我批评，树立了正确的人生观和价值观。</p><p>在经过四年的大学生活，我抱着对学习的热爱，刻苦努力、确立明确的学习目标。积极与老师同学沟通和请教、互相找出学习上不懂得问题及找出解决问题的方法。</p><p>大学这段时间，我始终保持着一颗积极的心，全心投入大学的生活，在保持好自己学习成绩的同时，积极参与学校活动，与身边的同学老师互动，处理好人际方面的问题。做好思想觉悟，不局限与课本上的知识，平时闲暇的时候就去图书馆补充各方面的知识，开拓视野，拓展知识面，弥补自己的不足，让自己明白学习的路途还有很远，避免产生自高自大的心态。学无止境，在学习这方面需要进步的空间太多太多，我会一直努力的走下去，不会让身边的人失望，不会让老师失望。</p><p>在生活上，养成了良好的生活习惯，生活充实而有条理，有严谨的生活态度和良好的生活态度和生活作风，为人热情大方，诚实守信，乐于助人，拥有自己的良好处事原则，能与同学们和睦相处;积极参加各项课外活动，从而不断的丰富自己的阅历。曾多次参加各项志愿活动，在阳光志愿者协会的活动中被评为“优秀志愿者”。</p><p>在性格上，虽然没有那么外向，但还是很好与人相处的。思想不迂腐，和周围的同学都能合得来，平时不管是学习上还是生活上都能互相帮助。这让我在大学的这段时间减少了很多不必要的麻烦，能够更加专心的去学习，去走好自己的路。俗话说，一个好汉三个帮，虽然我不是什么好汉，但是有那么多同学在身边，我坚信，我的路会走的比想象中的更远。在未来，我会制定出一个个小目标，一个个的实现，向我的大目标靠近，我会加倍努力，争取取得更好的成果！<br>&nbsp;</p>'),(4,1,'d','2022-04-28 16:23:00','2022-04-29 06:08:25','添加测试','描述','<p># 哈哈哈</p>'),(5,1,'k','2022-06-06 16:39:00','2022-06-06 16:39:00','定时测试','哈哈哈哈','<p style=\"margin-left:0px;\">在思想上，我做到了积极上进，热爱祖国、热爱人民，拥护中国共产党的领导、拥护党的各项方针政策，遵守国家的法律法规及各项规章制度。积极向党组织靠拢，于上学期向党递交入党申请书，并成为预备党员。有很强的上进心，勇于批评与自我批评，树立了正确的人生观和价值观。</p><p style=\"margin-left:0px;\"><br>&nbsp;</p><p style=\"margin-left:0px;\">在生活上，养成了良好的生活习惯，生活充实而有条理，有严谨的生活态度和良好的生活态度和生活作风，为人热情大方，诚实守信，乐于助人，拥有自己的良好处事原则，能与同学们和睦相处;积极参加各项课外活动，从而不断的丰富自己的阅历。曾多次参加各项志愿活动，在阳光志愿者协会的活动中被评为“优秀志愿者”。</p><p style=\"margin-left:0px;\"><br>&nbsp;</p><p style=\"margin-left:0px;\">经过大一上学期，我抱着对学习的热爱，刻苦努力、确立明确的学习目标。积极与老师同学沟通和请教、互相找出学习上不懂得问题及找出解决问题的方法。</p><p style=\"margin-left:0px;\">成绩充分说明了我在一些专业性不强的学科上存在短板，专业课的成绩较好，但是在如大学英语学科上下的功夫还不够。在今后的学习中应该加强对于这些学科的重视，提升自己的成绩。</p><p style=\"margin-left:0px;\"><br>&nbsp;</p><p style=\"margin-left:0px;\">&nbsp;</p><p style=\"margin-left:0px;\">&nbsp;</p>'),(6,3,'h','2022-05-09 14:44:57','2022-05-27 09:58:04','即时测试','哈哈','<p># 哈哈哈</p><p>&nbsp;</p><p style=\"margin-left:0px;\">不知不觉间我进入大学也有二年的时间了.回首过去的岁月,我收获了许多,也失去了许多,既有取得的进步,成功的喜悦,也有失败后的苦恼,但还是在这得失之间,成功与失败之间,我发觉自己长大了、成熟了、进步了。从一个幼稚的,单纯的中学生成长为一名有能力有思想、求进步的热血青年、大学生。这其中有上级组织的辛勤培养,老师、同学们的热心帮助,我只能以自己的不断努力来报答。</p><p style=\"margin-left:0px;\">　　在假期中,我看了许多,也想了许多,更明白了许多。我认为目前的大学生还应该进一步加强各方面的能力,并拓宽自己的知识面.社会的进步必须依靠科技的发展。现在我国正处于改革开放,日新月异的新的十年,正是社会主义现代化建设的重要时期,需要大批的有知识、有文化有能力的科技人才。而我们,当代的大学生,跨世纪的一代青年,应该怎样才能抓住这凸显自我价值,为提升我国国力的有利时期呢?我认为,首先应该学好自己的基础和专业文化知识,并在此基础上拓宽自己的知识面,这是我们作为学生最基本的任务,也是每一个人走上社会,干好工作,为祖国建设贡献力量的最重要的条件,在现代化高速发展的科技社会。</p><p style=\"margin-left:0px;\">　　重要的是,我们需要不断加强自己的思想教育,只有持续提高自己的思想素质,紧跟党的领导,为国家的繁荣富强做出自己的贡献。</p><p style=\"margin-left:0px;\">　　以上仅是我对目前大学生的一点看法及对生活的一点认识,当然自己应当更加努力,认真学习全面提高能力.新的学期开始了,每个人都有自己的目标与计划,当然 我也不例外.因此,我对自己提出以下要求:首先,学习上,我要认真对待每一节课,做好预习、复习工作,认真完成老师要求的各项作业,并且积极扩大学习范围,为以后的发展打下坚实的基础。</p>'),(7,1,'h','2022-04-28 17:20:21','2022-05-27 10:04:44','视频测试','哈哈','<p>哈哈哈</p><p>&nbsp;&nbsp;</p><p>在⼤学期间，我始终以提⾼⾃⾝的综合素质为⽬标，以⾃我的全⾯发展为努⼒⽅向，树⽴正确的⼈⽣观、价值观和世界观。为适应社会发展的需求，我认真学习各种专业知识，发挥⾃⼰的特长；挖掘⾃⾝的潜⼒，从⽽逐步提⾼了⾃⼰的学习能⼒和分析处理问题的能⼒以及⼀定的协调组织和管理能⼒。</p><figure class=\"media\"><oembed url=\"http://poem.maythorn.top/poem.mp4\"></oembed></figure>'),(8,3,'h','2022-04-28 17:27:08','2022-05-18 18:08:18','哔站视频测试','测试','<p>哈哈哈</p>'),(9,1,'h','2022-04-28 17:36:38','2022-04-28 17:36:38','油管视频测试','测试','<h1>哈哈</h1><figure class=\"media\"><oembed url=\"https://youtu.be/abv2S2sO6Uk\"></oembed></figure>'),(10,2,'s','2022-06-01 10:14:29','2022-06-01 10:14:29','编译，运行或解释语言版本介绍','沙箱环境介绍','<ul><li>C ( GCC 9.4 )/usr/bin/gcc -DONLINE_JUDGE -O2 -w -fmax-errors=3 -std=c11 {src_path} -lm -o {exe_path}</li><li>C++ ( G++ 9.4 )/usr/bin/g++ -DONLINE_JUDGE -O2 -w -fmax-errors=3 -std=c++14 {src_path} -lm -o {exe_path}</li><li>Java ( OpenJDK 11 )/usr/bin/javac {src_path} -d {exe_dir} -encoding UTF8</li><li>Python2 ( Python 2.7 )/usr/bin/python -m py_compile {src_path}</li><li>Python3 ( Python 3.6 )/usr/bin/python3 -m py_compile {src_path}</li><li>Golang ( Golang 1.17 )/usr/bin/go build -o {exe_path} {src_path}</li><li>JavaScript ( Node 14 )/usr/bin/node --check {src_path}</li></ul>'),(11,2,'s','2022-06-01 10:34:22','2022-06-01 10:34:22','评测结果解释','评测结果解释','<ul><li><strong>PE</strong> : 即 <strong>Pending</strong>，您正在评测中</li><li><strong>CE</strong> : 即 <strong>Compile</strong> <strong>Error</strong>，编译您的代码过程中出现错误，查看状态界面可以看到报错信息</li><li><strong>AE</strong> : 即<strong>Accepted</strong>，表明您的答案是正确的</li><li><strong>WA</strong>：即 <strong>Wrong Answer</strong> : 您的程序经过在线评测机运行后，答案与预定结果不相符，即答案错误</li><li><strong>RE：</strong>即 <strong>Runtime Error</strong> : 您的程序运行时不正常，可能导致该错误原因有：<span style=\"background-color:rgb(255,255,255);color:rgb(73,80,96);\">段错误、被零除、用非0的代码退出程序等</span></li><li><strong>TL：</strong>即 <strong>Time Limit Exceeded</strong> : <span style=\"background-color:rgb(255,255,255);color:rgb(73,80,96);\">您的程序使用的 CPU 时间已超出限制</span></li><li><strong>ML：</strong>即<strong> Memory Limit Exceeded</strong> : 您的<span style=\"background-color:rgb(255,255,255);color:rgb(73,80,96);\">程序实际使用的内存已超出限制</span></li><li><strong>SE：</strong>即 <strong>System Error</strong> : 评测机可能出现一些故障导致评测错误</li></ul>'),(12,2,'s','2022-06-01 18:53:10','2022-06-01 18:53:10','测试用例格式','问题所用测试用例格式讲解','<ul><li style=\"margin-left:0px;\">测试用例文件包括<code>in</code>和<code>out</code>两种拓展名</li><li style=\"margin-left:0px;\">每个测试用例的文件名须由数字开头（从1开始）</li><li style=\"margin-left:0px;\">例如有两组测试用例，则测试用例的文件名分别为<code>1.in, 1.out, 2.in, 2.out</code>，其他形式的文件后台均不识别。</li><li style=\"margin-left:0px;\">压缩时，请将文件都放在压缩包的根目录，而不是包含在某一个文件夹中</li><li style=\"margin-left:0px;\">如果是在图形界面下压缩，请选中需要压缩的文件，右键直接压缩</li></ul><p style=\"margin-left:0px;\">比如：正确的格式是</p><span lang=\"plaintext\" dir=\"undefined\"><pre><code class=\"language-plaintext\">➜  testcase pwd\n/tmp/testcase\n➜  testcase tree\n.\n├── 1.in\n├── 1.out\n\n0 directories, 2 files</code></pre></span><p style=\"margin-left:0px;\">下面是错误的，因为测试用例被放进文件夹“1”中</p><span lang=\"plaintext\" dir=\"undefined\"><pre><code class=\"language-plaintext\">➜  testcase pwd\n/tmp/testcase\n➜  testcase tree\n.\n├── 1\n│   ├── 1.in\n│   └── 1.out\n\n1 directories, 2 files</code></pre></span><p style=\"margin-left:0px;\">然后压缩测试用例到一个zip中</p><span lang=\"plaintext\" dir=\"undefined\"><pre><code class=\"language-plaintext\">➜  testcase zip testcase.zip ./{*.in,*.out}\n  adding: 1.in (stored 0%)\n  adding: 1.out (stored 0%)</code></pre></span><p style=\"margin-left:0px;\">查看压缩包的内容</p><span lang=\"plaintext\" dir=\"undefined\"><pre><code class=\"language-plaintext\">➜  testcase unzip -v testcase.zip\nArchive:  testcase.zip\n Length   Method    Size  Ratio   Date   Time   CRC-32    Name\n--------  ------  ------- -----   ----   ----   ------    ----\n       0  Stored        0   0%  04-28-16 16:27  00000000  1.in\n       0  Stored        0   0%  04-28-16 16:27  00000000  1.out\n--------          -------  ---                            -------\n       0                0   0%                            2 files</code></pre></span><p style=\"margin-left:0px;\">&nbsp;</p><p style=\"margin-left:0px;\">如果认为正确压缩了，但是还提示文件格式或者文件数量错误，请查看是否压缩进去了隐藏文件，Windows下可能是<code>$RECYCLE.BIN</code>等，Mac下是<code>.DS_Store</code>，Linux下可能是<code>1.in~</code>或者<code>.1.in.swp</code>文件。</p><p style=\"margin-left:0px;\">同时建议尽量合并测试用例到一个文件中，减少测试用例组数，这会一定程度上提高判题性能，降低选手代码运行时间</p>'),(13,2,'s','2022-06-02 05:43:58','2022-06-02 05:43:58','赛制介绍','在线评测系统赛制介绍','<p style=\"margin-left:0px;\">ACM赛制：每道题提交之后都有反馈，可以看到“通过”、“运行错误”、“答案错误”等等结果，但看不到错误的测试样例（leetcode周赛可以看到），每道题都有多个测试点，每道题必须通过了所有的测试点才算通过。<strong>每道题不限制提交次数，但没通过的话会有罚时，仅以最后一次提交为准</strong>。比赛过程中一般可以看到实时排名，通过题数相同的情况下按照答题时间+罚时来排名。ICPC、CCPC、codeforces比赛、leetcode周赛及全国编程大赛、牛客小白赛练习赛挑战赛、传智杯。</p><p style=\"margin-left:0px;\">OI赛制：每道题提交之后都没有任何反馈，每道题都有多个测试点，根据每道题通过的测试点的数量获得相应的分数。每道题不限制提交次数，如果提交错误没有任何惩罚，仅以最后一次提交为准。比赛过程中看不到实时排名，赛后按照总得分来排名。NOI全国青少年信息学奥林匹克竞赛、CCF CSP、考研机试、<strong>蓝桥杯、牛客OI赛、全国高校计算机能力挑战赛。</strong></p><p style=\"margin-left:0px;\">IOI赛制：每道题提交之后都有反馈，可以看到“通过”、“运行错误”、“答案错误”等等结果，甚至可以实时看到自己每道题得了多少分，但看不到错误的测试样例。每道题都有多个测试点，根据每道题通过的测试点的数量获得相应的分数。每道题不限制提交次数，如果提交错误没有任何惩罚，仅以最后一次提交为准。比赛过程中一般可以看到实时排名（如果是考试，一般看不到排名），按照总得分来排名。可以说，IOI赛制是结合了OI赛制和ACM赛制的特点。</p>');
